import React from 'react';
import Table from './components/Tables/tables'
import './App.css';
import Analysis from './components/analysis'

class App extends React.Component{
  render(){
    return (
      <div className="App">
        <header className="App-header">
          <p className ="table">
           <Table/>
          </p>
          <Analysis/>
          <button onClick={<a href="test.html"></a>}>
            Analytics
          </button>
        </header>
      </div>

    );
  }
}

export default App;
